import React from 'react'
import './AutoWizard.css';

import { connect } from 'react-redux';
import { setWizardIntentType } from '../../../redux/actions/wizardActions';

import {
    Row,
    Col
} from 'react-bootstrap';

import {
    withRouter,
} from 'react-router-dom';

function WizardPopup(props) {
    const { history } = props;

    return (
        <>
        <Row style={{height: window.innerHeight}} className="d-flex">
            <div className="mt-5 mx-auto wizard-popup d-flex flex-column">
                <Row className="my-auto mt-5">
                    <Col lg={2} />

                    <Col>
                        <div className="m-auto wizard-popup-btn d-flex" onClick={() => props.setWizardIntentType('default',history)}>
                            <p className="m-auto">Specific postâ€™s comment</p>
                        </div>
                    </Col>

                    <Col lg={2} />
                </Row>
                
                <Row className="my-auto mb-5">
                    <Col lg={2} />

                    <Col>
                        {/* <Link to="/home/auto-wizard" style={{textDecoration: 'none'}} onClick={() => setWizardIntentType('generic')}> */}
                            <div className="m-auto wizard-popup-btn d-flex" onClick={() => props.setWizardIntentType('generic',history)}>
                                <p className="m-auto">Generic intents</p>
                            </div>
                        {/* </Link> */}
                    </Col>

                    <Col lg={2} />
                </Row>
            </div>
        </Row>
        </>
    );
}


const mapStateToProps = (state) => ({
    wizardIntentType: state.wizardR.wizardIntentType,
})

export default withRouter(connect(mapStateToProps, { setWizardIntentType })(WizardPopup))
